import "./App.css";
import { Route } from "react-router";
import BackgroundVideo from './image/gif.mp4'
import Poster from './image/1.PNG'

import Home from "./components/Home";

function App() {
  return (
    <div className="App">
      <video
        id="background-video"
        autoplay
        loop
        muted
        poster={Poster}
      >
        <source
          src={BackgroundVideo}
          type="video/mp4"
        />
      </video>
      <Home />
    </div>
  );
}

export default App;
